import React from "react";
import Data from "../../utils/MOCK_DATA.json"
import Row from "../Row";

function Table(props) {
    return (
        <table className="table">
        <thead>
          <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Gender</th>
            <th>Email</th>
            <th>Phone Number</th>
            <th>Country</th>
            <th>Department</th>
          </tr>

          </thead>
          {Data.map( item => (
            <Row>
              {item.first_name,
             item.last_name,
             item.gender,
             item.email,
             item.phone_number,
             item.country,
             item.department}
             </Row>

          ))}





      </table>

    );
  }

  export default Table;
